//
static void _Draw(void * p)
{	
	u8 x,y;
	PARAM * pParam;
	pParam = (PARAM *)p;
	
	//
	if (pParam->AutoDevInfo.DrawFixed) 
	{
		GUI_DrawBitmap(&bmwatch,0, 0);
	}

	//
	GUI_SetColor(GUI_RED);
	GUI_AA_FillPolygon(pParam->HourPoints, 4, MAG * 120, MAG * 120);  //
	
	//
	GUI_AA_FillPolygon(pParam->MinPoints, 4, MAG * 120, MAG * 120);  //
	
	//
	x=120+(95*cos((float)(3.1412/2-6*(My_Clock.sec)*3.1412/180)));
	y=120-(95*sin((float)(3.1412/2-6*(My_Clock.sec)*3.1412/180)));
	GUI_AA_DrawLine(x*2,y*2,120*2,120*2);

	
	//
	if (pParam->AutoDevInfo.DrawFixed) {
		GUI_FillCircle(120,120,8); //
		GUI_SetTextMode(GUI_TM_TRANS);
		GUI_SetColor(GUI_YELLOW);
		GUI_SetFont(&GUI_Font24_ASCII);
		//
		GUI_DispStringAt("2016",53,170);
		//
		if((My_Clock.month)<10)
		{
			GUI_DispDecAt(My_Clock.month,123,170,1);
		}
		//
		if((My_Clock.date)<10)
		{
			GUI_DispDecAt(My_Clock.date,157,170,1);		
		}
		else
		{
			GUI_DispDecAt(My_Clock.date,153,170,2);
		}
		//
		GUI_SetFont(&GUI_Fontmytimefont);
		GUI_DispStringAt("\xe5\xb9\xb4",103,170);	//
		GUI_DispStringAt("\xe6\x9c\x88",133,170);	//
		GUI_DispStringAt("\xe6\x97\xa5",175,170);	//
		GUI_DispStringAt("\xe5\x91\xa8",160,100);	//
		//
		switch(My_Clock.week)
		{
			case 1 :GUI_DispStringAt("\xe4\xb8\x80",180,100);	break;//
			case 2 :GUI_DispStringAt("\xe4\xba\x8c",180,100);	break;//
			case 3 :GUI_DispStringAt("\xe4\xb8\x89",180,100);	break;//
			case 4 :GUI_DispStringAt("\xe5\x9b\x9b",180,100);	break;//
			case 5 :GUI_DispStringAt("\xe4\xba\x94",180,100);	break;//
			case 6 :GUI_DispStringAt("\xe5\x85\xad",180,100);	break;//
			case 7 :GUI_DispStringAt("\xe6\x97\xa5",180,100);	break;//
			default: break;
		}	
		
		
	}
//	

}


void Disp_Watch(void)
{
	GUI_AUTODEV AutoDev;    // Object for banding memory device
	PARAM       Param;      // Parameters for drawing routine
	//Param.sec = My_Clock.sec;
	//Param.day = My_Clock.date;
	//Param.week = My_Clock.week;
	
	//
	GUI_MEMDEV_CreateAuto(&AutoDev); //
	//
	Param.MinAngle = (-My_Clock.min*6*3.1412/180);
	Param.HourAngle = (-(My_Clock.hour*5+My_Clock.min/12.0)*6*3.1412/180);
	GUI_RotatePolygon(Param.MinPoints,_aPointMin, 4, Param.MinAngle); //
	GUI_RotatePolygon(Param.HourPoints,_aPointHour, 4, Param.HourAngle); //

	//
	GUI_MEMDEV_DrawAuto(&AutoDev, &Param.AutoDevInfo, &_Draw, &Param);  //
	GUI_MEMDEV_DeleteAuto(&AutoDev);//
}



